"use strict";

class ProductTwo
{
    constructor()
    {
        this.hasCanvas = false;
        this.canvas = null;
        this.ctx = null; 
        this.w = 350;
		this.h = 200;
        this.svg = null;
        this.ns = "http://www.w3.org/2000/svg";
        this._title = $(document).find("title").text().toLowerCase();
		
		this.txt =  $("*[title='Enter your name here']").eq(0);
		this.selOne = null;
		this.selTwo = null;
		this.presetName = String.fromCharCode(60065)+"ngelin"+String.fromCharCode(61097);
		$(this.txt).val("Angelina");
	}
	
    test(){console.log("ProductTwo.class");}
	
    loadSvg()
    {
		 try
		 {
			console.log(this._title);
			this.canvas = $("canvas").get(0);
			this.ctx = this.canvas.getContext("2d");

			var msg = new Item().svg();
			var parser = new DOMParser();

			this.svg = parser.parseFromString(msg,"image/svg+xml");
			this.svg.getElementsByTagName("text")[0].textContent = this.presetName;
			this.drawSvg(this.svg);   

			console.log("SVG Loaded at: " + this._title);
		 }
		 catch(e)
		 {
			 console.log("loadSvg: " + e);
		 }
    }
	
    getInput()
    {
		try
		{
			this.txt = $("*[title='Enter your name here']").eq(0); 
		}
		catch(e)
		{
			console.log("getInput: " + e)
		}
    }
	
    getSelAccent()
    {
        try
		{
			let tgt = $('select').toArray();
			this.selOne =  $(tgt).eq(1);
		  //console.log("accent: " + $(tgt)[2].options[1].text);
		}
		catch(e)
		{
				console.log("getAccent" + e);
		}
    }
	
    getSelAlloy()
    {
		try
		{       
			let tgt = $('select').toArray();
			$.each(tgt, (index)=> 
			{
				if($(tgt)[index].options[1].text === "Silver")
				{
					this.selTwo =  $(tgt)[index];
					console.log($(tgt)[index].options[1].text);
				}	
			});
		}
		catch(e)
		{
				console.log("getAlloy: " + e);
		}
    }
	
    clsCanvas()
    {
		try
		{
				this.canvas = $("#canvas").get(0);
				this.ctx = this.canvas.getContext("2d");
				this.ctx.clearRect(0, 0, this.w, this.h);
		}
		catch(e)
		{
				console.log(e);
		}	
    }
		
	resetCanvas()
    {
        if($(this.txt).val() === "")
        {
            console.log("empty/clear canvas");
            this.clsCanvas();
        }
    }
	
    textFactory(svgDoc, inputName, selectEndOne)
    {
        try 
        {
			if(selectEndOne === 'undefined'){selectEndOne = 0; console.log("selectEndOne undefined: " + selectEndOne);}
			if(inputName === 'undefined'){inputName = "Cara";console.log("my input: " + inputName)}
            //suffix map
             var SUFFIX = {0:61000 + inputName.codePointAt(inputName.length-1), 1:61043, 2:61095,3:61043,4:61095};
            // var SUFFIX = {0:61043, 1:61095,2:61043,3:61095};

            const x = 60000;
            const y = 61000;
            var regex = /[\(\)\[\]:;#@\^\|\?\",<>\!\\_=\+\*~`\.\{\}']/g;

            inputName = inputName.split(" ").join("");
            inputName = inputName.replace(regex, "");
            
            //map prefix, body, suffix
            let _a, _b, _c, _d;

			_a = "";
            if(inputName.substring(0,1).match(/^[\&|\-]/g))
            {
                return;
            }
			else if(inputName === 'Enteryournamehere')
			{
				return;
			}    
            else if(inputName.length > 0)
            {
                _a = String.fromCharCode(inputName.charCodeAt(0) + x);
				_d = inputName;
            }
			
            _b = "";
            if(inputName.length > 1)
            {
                _b = inputName.substring(1,inputName.length-1);
            }
            
			
			_c = "";
			if(selectEndOne === 0 && inputName.length > 1 )
			{
				
				_c = String.fromCharCode(SUFFIX[selectEndOne]);
			}
			else if((selectEndOne === 1 || selectEndOne === 2) &&  inputName.length === 1)
			{
				_c =String.fromCharCode(SUFFIX[selectEndOne]);
			}
			else if((selectEndOne === 1 || selectEndOne === 2) &&  inputName.length > 1)
			{
				_c = inputName.substring(inputName.length-1,inputName.length) + String.fromCharCode(SUFFIX[selectEndOne]);
			}
		
			else if(selectEndOne > 2)
			{
				_a = "";
				_b = String.fromCharCode(SUFFIX[selectEndOne]-1000).concat(_d).concat(String.fromCharCode(SUFFIX[selectEndOne]));
				_c = "";
			}

			var _target = svgDoc.getElementsByTagName("text")[0];
			_target.textContent = "";
		
			var _prefix ,_body, _suffix;
			_prefix = document.createElementNS(this.ns,"tspan");
			_body = document.createElementNS(this.ns,"tspan");
			_suffix = document.createElementNS(this.ns,"tspan"); 
		   
			_prefix.textContent = _a;
			_body.textContent = _b;
			_suffix.textContent = _c;

			_target.appendChild(_prefix);
			_target.appendChild(_body);
			_target.appendChild(_suffix);
			
            
        } 
        catch (e) 
        {
            console.log("textFactory: " + e);
        }
    }
	
	scaleCanvas()
	{
		$("#canvas").mouseenter(()=>
		{
			try 
			{
				
				var serializer = new XMLSerializer();
				var svgString = serializer.serializeToString(this.svg);

				var img = new Image();
				img.src = "data:image/svg+xml,".concat(encodeURIComponent(svgString));

				img.onload = ()=> 
				{
					this.clsCanvas();
					this.ctx.drawImage(img, -40, -30, this.w*1.2, this.h*1.2);
				};
			} 
			catch(e) 
			{
				console.log("scaleCanvas: "+e);
			}
		})
		.mouseout(()=>
		{
			try 
			{
				
				var serializer = new XMLSerializer();
				var svgString = serializer.serializeToString(this.svg);

				var img = new Image();
				img.src = "data:image/svg+xml,".concat(encodeURIComponent(svgString));

				img.onload = ()=> 
				{
					this.clsCanvas();
					this.ctx.drawImage(img,0 , 0, this.w, this.h);
				};
			} 
			catch(e) 
			{
				console.log("scaleCanvas: "+e);
			}
		});
	}
	
    drawSvg(svgDoc)
    {
        try 
        {
            var serializer = new XMLSerializer();
            var svgString = serializer.serializeToString(svgDoc);

            var img = new Image();
            img.src = "data:image/svg+xml,".concat(encodeURIComponent(svgString));

            img.onload = ()=> 
            {
                this.clsCanvas();
                this.ctx.drawImage(img, 0, 0, this.w, this.h);
            };
        } 
        catch(e) 
        {
            console.log("drawSvg: "+e);
        }
    }
	alloyColor(selTwo)
	{
		try
		{
			var alloy = {0:"#b4b4b4",1:"#b4b4b4", 2:"#bbb100", 3:"#e0afbc", 4:"#a3a3a3"};
			let _target = this.svg.getElementsByTagName("text")[0];
			_target.style.fill = alloy[selTwo];
		}
		catch(e)
		{
			console.log("alloyColor: " + e);
		}
	}
	
	
	interactivity()
	{
		try
		{
			this.getInput()
			this.getSelAlloy();
			this.getSelAccent();
		
			this.resetCanvas();
			//update text
			this.textFactory(this.svg, $(this.txt).val(), $(this.selOne).prop("selectedIndex"));
			//update alloy
			this.alloyColor($(this.selTwo).prop("selectedIndex"));
			//paint canvas
			this.drawSvg(this.svg);
		}
		catch(e)
		{
			 console.log("interactivity: " + e);
		}
	}
   render()
   {           
		$(document)
			.on("keyup",$(this.txt),(evt)=>
			{
				try 
				{
					this.interactivity();
				} 
				catch (e) 
				{
					console.log("render: " + e);
				}
			})
			.bind("change",$(this.selOne),(evt)=> 
			{
				try 
				{
					this.interactivity();
				} 
				catch (e) 
				{
					console.log("render: " + e);
				}
			});
    }
    
    init()
    {
		if($("#canvas").length > 0)
		{
				this.loadSvg();
				this.render();
				this.scaleCanvas();
		}
		else
		{
			console.log("No Canvas Found/Contact product.js vendor");
		}
    }
}

class Item
{
	svg()
	{
		
		
		return "<svg xmlns:svg='http://www.w3.org/2000/svg' xmlns='http://www.w3.org/2000/svg' xmlns:xlink='http://www.w3.org/1999/xlink' width='350' height='200'>"
		.concat("<defs>")
		.concat("<style type='text/css'>@font-face")
		.concat("{")
		.concat("font-family:'wz_bname';")
		.concat("font-weight:normal;")
		.concat("font-style:normal;")
		.concat("src:url(data:application/font-woff;charset=utf-8;base64,) format('woff');")
		.concat("}")
		.concat("</style>")
		
		.concat("<filter id='Bevel' filterUnits='objectBoundingBox' x='-10%' y='-10%' width='150%' height='150%'>")
		.concat("<feGaussianBlur in='SourceAlpha' stdDeviation='0.2' result='blur'/>")
		.concat("<feSpecularLighting in='blur' surfaceScale='5' specularConstant='0.5' specularExponent='5' result='specOut' lighting-color='white'>")
		.concat("<fePointLight x='-5000' y='-5000' z='8000'/>")
		.concat("</feSpecularLighting>")
		.concat("<feComposite in='specOut' in2='SourceAlpha' operator='in' result='specOut2'/>")
		.concat("<feComposite in='SourceGraphic' in2='specOut2' operator='arithmetic' k1='0' k2='1' k3='1' k4='0' result='litPaint' />")
		.concat("</filter>")
		
		.concat("</defs>")
		
		.concat("<g><text id='txt1' style='font-size:25;stroke:none;text-anchor:middle;font-family:wz_bname' filter='url(#Bevel)' fill='#bbb100' transform='matrix(1 0 0 1 175 110)' >Nina</text></g>")
		.concat("</svg>");
	}	
}


